            break;
        }
        else if(ch[i][3]=='O'&&ch[i][4]=='O')
        {
            ch[i][3]='+';
            ch[i][4]='+';
            break;
        }
    }
    if(i==n)
        printf("NO\n");
    else
    {
        printf("YES\n");
        for(i=0;i<n;i++)
        {
            for(j=0;j<5;j++)
            {
                printf("%c",ch[i][j]);
            }
            printf("\n");
        }
    }
    return 0;
}
