['#include<stdio.h>

int main()
{
    int n,i=-1,j=-1,r,c,k;
    scanf("%d",&n);
    char s[n][6];
    for(r=0;r<n;r++){
          scanf("%s",s[r]);
    }
    for(r=0;r<n;r++){
        for(c=0;c<4;c++){
            if(s[r][c]=='O'&&s[r][c+1]=='O'){
                k=r;
                i=c;
                j=c+1;
                printf("YES\n");
                goto abc;
            }
        }
    }
    if(i==-1){
        printf("NO");
        return 0;
    }
    abc: s[k][i]='+';
    s[k][j]='+';
    for(r=0;r<n;r++){
        printf("%s",s[r]);
        printf("\n");
    }
    return 0;
}']

