['#include<stdio.h>
#include<conio.h>
int main()
{
	int i,j,c,r,d,b;
	char a[50][50];

	printf("Enter no of columns : ");
	scanf("%d",&c);

	for(i=0;i<c;i++)
	{
		scanf(" %c",&a[i][0]);
		scanf("%c",&a[i][1]);
		scanf("|%c",&a[i][2]);
		scanf("%c",&a[i][3]);
	}
	for(i=0;i<c;i++)
	{
		for(j=0;j<4;j++)
		{
			if(a[i][j]=='0'&&a[i][j+1]=='0')
			{
				d=i;
				b=j;
				goto OUT;
			}
			else
				j++;
		}
	}
	OUT:
	for(i=0;i<c;i++)
	{
		for(j=0;j<4;j++)
		{
			if(i==d&&j==b)
			{
				a[i][j]='+';
				a[i][j+1]='+';
			}
		}
	}
	for(i=0;i<c;i++)
	{
		printf(" %c",a[i][0]);
		printf("%c",a[i][1]);
		printf("|%c",a[i][2]);
		printf("%c",a[i][3]);
		printf("\n");
	}
}']

