['#include <stdio.h>
#include <stdbool.h>

void adjacent_seats() {
	int print = 0;
	int rows;
	scanf("%d", &rows);
	int seats = 6 * rows;
	char config[seats];
	for (int i = 0; i < seats + 1; i++) {
		char c;
		scanf("%c", &c);
		config[i] = c;
	}
	for (int j = 0; j < rows; j++) {
		if ((config[(6 * j) + 1] == 'O') && (config[(6 * j) + 2] == 'O')) {
			config[(6 * j) + 1] = config[(6 * j) + 2] = '+';
			print = 1;
			break;
		} else if ((config[(6 * j) + 4] == 'O') && (config[(6 * j) + 5] == 'O')) {
			config[(6 * j) + 4] = config[(6 * j) + 5] = '+';
			print = 1;
			break;
		} else {
			continue;
		}
	}
	if (print) {
		printf("YES\n");
		for (int k = 0; k < rows; k++) {
			 printf("%c%c%c%c%c\n", config[(6 * k) + 1], config[(6 * k) + 2], config[(6 * k) + 3], config[(6 * k) + 4], config[(6 * k) + 5]);
		}
	} else {
		printf("NO\n");
	}
}



int main() {
	adjacent_seats();
	return 0;
}']

