['#include<stdio.h>
#include<stdlib.h>
main(void)
{
	int n,i,j,l,k;
	scanf("%d",&n);
	unsigned long long int sq[500][500],sum1,sum,n1,n2;
	for(i=0;i<n;i++){
		for(j=0;j<n;j++){
			scanf("%llu",&sq[i][j]);
			if(sq[i][j]==0){
				l=i;
				k=j;
			}
		}
	}
	if(n==1){
		printf("1");
		exit(1);
	}
	sum=0;
	sum1=0;
	for(i=0;i<n;i++){
		if(i==l)continue;
		for(j=0;j<n;j++){
			sum1+=sq[i][j];
		}
		if(sum==0)sum=sum1;
		else if(sum1!=sum){
			printf("-1");
			exit(1);
		}
		sum1=0;
	}
	for(j=0;j<n;j++){
		if(j==k)continue;
		for(i=0;i<n;i++){
			sum1+=sq[i][j];
		}
		if(sum1!=sum){
			printf("-1");
			exit(1);
		}
		sum1=0;
	}
	if(k!=l){
		for(i=0,j=0;i<n;i++,j++)sum1+=sq[i][j];
		if(sum1!=sum){
			printf("-1");
			exit(1);
		}
		sum1=0;
	}
	if((k+l)!=(n-1)){
		for(i=0,j=n-1;i<n;i++,j--)sum1+=sq[i][j];
		if(sum1!=sum){
			printf("-1");
			exit(1);
		}
		sum1=0;
	}
	for(j=0;j<n;j++)sum1+=sq[l][j];
	n1=sum-sum1;
	sum1=0;
	for(i=0;i<n;i++)sum1+=sq[i][k];
	n2=sum-sum1;
	if(n1==n2)printf("%llu",n1);
	else printf("-1");	
}']

