['#include<stdio.h>
int main()
{
    int n,i,j,count=0;
    scanf("%d",&n);
    long long int x=0;
    long long int sum[2*n];
    int ara[n][n];
    for(int tc=0;tc<n;tc++)
    {
        long long int add=0;
        for(int tc1=0;tc1<n;tc1++)
        {
            scanf("%d",&ara[tc][tc1]);
            if(ara[tc][tc1]==0)
            {
                i=tc,j=tc1;
            }
        }
        if(tc!=i)
        {
            for(int tc1=0;tc1<n;tc1++)
            {
                add=add+ara[tc][tc1];
            }
            sum[count]=add;
            count++;
        }
    }
    for(int tc=0;tc<n;tc++)
    {
        long long int add=0;
        if(tc!=j)
        {
            for(int tc1=0;tc1<n;tc1++)
            {
                add=add+ara[tc1][tc];
            }
            sum[count]=add;
            count++;
        }
    }
    if(i!=j)
    {
        long long int add=0;
        for(int tc=0;tc<n;tc++)
        {
            add=add+ara[tc][tc];
        }
        sum[count]=add;
        count++;
    }
    if(i+j!=n-1)
    {
        long long int add=0;
        for(int tc=0;tc<n;tc++)
        {
            add=add+ara[tc][n-1-tc];
        }
        sum[count]=add;
    }
    for(int tc=0;tc<n;tc++)
    {
        x=x+ara[i][tc];
    }
    for(int tc=1;tc<count;tc++)
    {
        if(sum[tc-1]!=sum[tc])
        {
            x=-1;
            break;
        }
    }
    if(x==-1)
    {
        printf("%lld\n",x);
    }
    else
    {
        x=sum[0]-x;
        printf("%lld\n",x);
    }
    
    return 0;
}']

