['#include <stdio.h>
#include <ctype.h>

int main() {
  int busSize, c, f;
  scanf("%d", &busSize);
  int temp[busSize][5];
  for (int i = 0; i < busSize; i++) {
    for (int j = 0; j < 5; j++) {
      scanf(" %c", &c);
      if(isspace(c) != 1)
        temp[i][j] = c;
    }
  }

  for (int i = 0; i < busSize; i++) {
    if (temp[i][0] == 'O' && temp[i][1] == 'O') {
      temp[i][0] = '+';
      temp[i][1] = '+';
      f = 1;
      break;
    } else if (temp[i][3] == 'O' && temp[i][4] == 'O') {
      temp[i][3] = '+';
      temp[i][4] = '+';
      f = 1;
      break;
    }
  }

  if (f == 1) {
    printf("YES");
    for (int i = 0; i < busSize; i++) {
      for (int j = 0; j < 5; j++)
      printf("%c", temp[i][j]);
      printf("\n");
    }
  }else
    printf("NO");

  return 0;
}
