                k++;
                if(k==2) break;
            }
            if(ara[i][j] == 'X' || ara[i][j]=='|'){
                k=0;
            }
        }
        if(k==2) break;
    }
    if(j<2){
        strcpy(con[i],"++|OX");
    }
    if(j>2){
        strcpy(con[i], "XO|++");
    }
    for(m=0; m<=n; m++){
            if(m!=i){
                strcpy(con[m], ara[m]);
            }
    }
    if(k==2){
        printf("YES");
            for(p=0; p<=n; p++){
        printf("%s\n", con[p]);
    }
    }
    else printf("NO");
    return 0;
}
