['#include <stdio.h>

#define N 1000
#define S 5

int bus[N + 1][S + 1];

int main(void) {
    int n, i, j, c;

    int happyfriends = 0;

    scanf("%d\n", &n);
    for (i = 0; i < n; ++i) {
        for (j = 0; j < S; ++j) {
            c = getchar();
            bus[i][j] = c;
        }
        c = getchar();
    }

    for (i = 0; i < n; ++i) {
        if (!happyfriends) {
            if (bus[i][0] == 'O' && bus[i][1] == 'O') {
                bus[i][0] = bus[i][1] = '+';
                happyfriends = 1;
            } else if (bus[i][3] == 'O' && bus[i][4] == 'O') {
                bus[i][3] = bus[i][4] = '+';
                happyfriends = 1;
            }
        }
    }

    if (happyfriends) {
        printf("YES\n");
        for (i = 0; i < n; ++i) {
            for (j = 0; j < S; ++j) {
                putchar(bus[i][j]);
            }
            putchar('\n');
        }
    } else {
        printf("NO\n");
    }

    return 0;
}
